import {
  Navbar,
  Nav,
  NavbarBrand,
  NavItem,
  Container,
  Form,
  FormControl,
  Button
} from "react-bootstrap";
import "../Styles/header.css";

export class NavBar extends React.Component {
  render() {
    return (
      <div>
        <Navbar id="navtheme" style={{ padding: 0 }}>
          <Nav>
            <NavbarBrand>
              <img
                src={require("../Images/logo.png")}
                alt="logo"
                height="53px"
                width="200px"
              />
            </NavbarBrand>
          </Nav>
          <Nav inline className="d-flex align-content-end">
            <Nav.Link href="/" id="navItem">
              Explore Restaurants
            </Nav.Link>
          </Nav>
        </Navbar>
